(1, '1', 'If you are given only a compass and ruler which angle is not possible to construct? ', 'यदि आपको केवल एक कम्पास और पैमाना दिया जाता है तो किस कोण का निर्माण संभव नहीं है?', '30 Degree', '30 डिग्री', '90 Degree', '90 डिग्री', '40 Degree', '40 डिग्री', '120 Degree', '120 डिग्री', 'single', 'C', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image1', '1', 'N', 'admin'),
(2, '1', 'How many types of chains are used in chains surveying?', 'जरीब सर्वेक्षण में कितने प्रकार की जंजीरों का प्रयोग किया जाता है?', '4', '4', '6', '6', '5', '5', '8', '8', 'single', 'C', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image2', '1', 'N', 'admin'),
(3, '1', 'Pick up the correct statement from the following: ', 'निम्नलिखित में से सही कथन को चुनें-', 'The length of the brass handle is included in the length of chain ', 'जरीब की लम्बाई में पीतल का हैंडिल भी निहित होता है', 'The handles are on swivel joints to prevent twisting of the chain ', 'जरीब को एठन को रोकने के लिए हैंडल को  स्विवेल जोड़ पर रखा जाता है', 'The fifth tag from either end of the chain is numbered 5 ', 'जरीब के दोनो सिरों से पांचवें टैग का क्रम संख्या 5 होती है', 'All the above ', 'उपरोक्त सभी', 'single', 'D', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image3', '1', 'N', 'admin'),
(4, '1', 'Surveys which are carried out to depict mountains, rivers, water bodies, forest areas and other cultural details, are known as ', 'वह सर्वेक्षण जिसमें पहाड़, नदियाँ, जल क्षेत्र, जंगली क्षेत्र एवं सांस्कृतिक विस्तार दिखाया गया हो उसे कहते हैं -', 'Cadastral surveys ', 'कैडस्ट्रल सर्वेक्षण', 'City surveys ', 'नगर सर्वेक्षण', 'Topographical surveys ', 'स्थलाकृतिक सर्वेक्षण', 'Guide map surveys ', 'गाइड मानचित्र सर्वेक्षण', 'single', 'C', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image4', '1', 'N', 'admin'),
(5, '1', 'In Quadrantal Bearing system, back bearing of a line may be obtained from its forward bearing, by ', 'चतुर्पांद दिकमान विधि में किसी रेखा के अग्र दिकमान से पश्य दिकमान प्राप्त करने के लिए -', 'Adding 180°', '180° जोड़ना', 'if the given bearing is less than 180° then add 180 ', 'यदि दिया हुआ दिकमान 180 से कम हो तो 180 जोड़ा जाता है', 'Subtracting 180°', '180° घटाना।', 'All the above ', 'उपरोक्त सभी', 'single', 'C', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image6', '1', 'N', 'admin'),
(6, '1', 'If the whole circle bearing of a line is 270°, its reduced bearing is  ', 'यदि किसी रेखा का पूर्ण वृत दिकमान 270 डिग्री है तो इसका समानीत दिकमान होगा-', 'N 90° W', 'N 90° W', 'S 90° W', 'S 90° W', 'W 90°', 'W 90°', 'E 90° W', 'E 90° W', 'single', 'C', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image7', '1', 'N', 'admin'),
(7, '1', 'For true difference in elevations between two points ‘A’ and ‘B’, the level must be set up ', 'दो विन्दुओं Aऔर B के बीच का सही तलान्तर निकालने के लिए लेवेल को निष्चित रुप से स्थापित करना चाहिए', 'At any point between A and B ', 'Aऔर B के बीच किसी बिन्दु पर', 'At the exact midpoint of A and B ', 'A और B के पूर्णतः मध्य बिन्दु पर', 'Near the point A ', 'A बिन्दु के निकट', 'Near the point B  ', 'B बिन्दु के निकट', 'single', 'B', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image8', '1', 'N', 'admin'),
