(197, '1', 'While working on a plane table, the correct rule is: \r\n', 'प्लेन टेबुल पर कार्य करते समय सही नियम होता है -\r\n', 'Draw continuous lines from all instrument stations \r\n', 'सभी उपकरण स्टेशनों से निरंतर रेखाएँ खींचें\r\n', 'Draw short rays sufficient to contain the points sought \r\n', 'सभी अवलोकित विन्दुओं से होते है छोटी किरणें खींचना\r\n', 'Intersection should be obtained by actually drawing second rays \r\n', ' वास्तव में द्वितीय किरण खींचने पर ही कटान विन्दु प्राप्त किया जा सकता है\r\n', 'Take maximum number of sights as possible from each station to distant objects \r\n', 'प्रत्येक स्टेशन से अधिक से अधिक अवलोकन लेना जो दूरस्थ वस्तुओं को मिलाती है\r\n', 'single', 'B', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image5', '1', 'N', 'admin'),
(198, '1', 'Pick up the correct statement from the following: \r\n', ' निम्नलिखित में से सही कथन को चुनें\r\n', 'In the earth''s magnetic field, a magnetic needle rests in magnetic meridian \r\n', 'पृथ्वी के चुम्बकीय क्षेत्र में चुम्बकीय सूई चुम्बकीय याम्योतर की दिषा में रुकती है\r\n', 'One end of the magnetic needle supported at its centre of gravity tends to dip down towards the nearer magnetic pole of the earth  \r\n', 'अपने गुरुत्व केन्द्र पर किलित चुम्वकीय सूई का एक सिरा नीचे जाता है पृथ्वी के उस चुम्वकीय ध्रुव की ओर जो नजदीक पड़ता है\r\n', 'The angle between the true meridian and the magnetic meridian is called magnetic variation \r\n', 'निरपेक्ष याम्योतर एवं चुम्कीय याम्योतर के बीच के कोण को चुम्वकीय दिकपात कहते हैं\r\n', 'None of the above  \r\n', 'इनमें से कोई नहीं\r\n', 'single', 'B', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image22', '1', 'N', 'admin'),
(199, '1', 'Whole circle bearing of a line is preferred to a quadrantal bearing merely because \r\n', 'चतुर्थांष बियरिंग की अपेक्षा पूर्णवृत बियरिंग को पसंद किया जाता है-\r\n', ' Quadrantal Bearing is not completely specified by an angle  \r\n', 'चतुर्थांष बियरिंग को केवल कोण से पूर्णतः उल्लेखित नहीं किया जा सकता है\r\n', 'Whole circle Bearing is completely specified by an angle  \r\n', 'पूर्णवृत बियरिंग को केवल कोण से पूर्णतः उल्लेखित किया जा सकता है\r\n', 'Sign of the correction of magnetic declination is different in different quadrants  \r\n', 'चुम्वकीय दिकपात के निराकरण का चिन्ह विभिन्न चतुर्थांस में भिन्न होते हैं।\r\n', 'Its Trigonometrical values may be extracted from ordinary tables easily  \r\n', 'इसका त्रिकोणमीतिय मान समान्य सारणी से असानी से निकाला जा सकता है\r\n', 'single', 'B', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image40', '1', 'N', 'admin'),
(200, '1', 'If the chain line which runs along N-S direction is horizontal and the ground in E-W direction is sloping \r\n', 'यदि N-S दिशा में चलने वाली श्रृंखला रेखा क्षैतिज है और E-W दिशा में जमीन ढलान वाली हो तो -\r\n', 'It is possible to set offsets correctly on east side\r\n', 'ऑफसेट को पूर्व दिशा में सही ढंग से सेट करना संभव है\r\n', 'It is possible to set offsets correctly on west side  \r\n', 'पश्चिम दिशा में ऑफ़सेट सही ढंग से सेट करना संभव है\r\n', 'It is not possible to set offsets correctly on west side \r\n', 'पश्चिम दिशा में ऑफ़सेट सही ढंग से सेट करना संभव नहीं है\r\n', 'It is possible to set offsets correctly on both sides \r\n', 'दोनों तरफ ऑफसेट को सही ढंग से सेट करना संभव है|\r\n', 'single', 'D', 'N', '2023-09-23 08:58:36', NULL, 'Y', 'image55', '1', 'N', 'admin');
